import React from 'react'

export function PerfilUsuario({Perfil}) {
  return (
    <><div className='container'>
       <div><img src={Perfil.url_imagen} alt='Imagen de perfil' className='rounded-full mt-2 mb-2 hover:bg-fuchsia-600'/></div>
    </div>
        
    </>
  )
}
